import michael from '../image/michael.jpg'


const AboutUs = () => {
    return ( 
        <div className = 'about-us'>
            <h1>AboutUs</h1>

            <div className = 'aboutus-info'>
                <img src = {michael} width = "200" alt = "logo" /> 
                <h1>Creator: Michael Ibeh</h1>
            </div>

        </div>
    );
}
 
export default AboutUs;
